import React,{useContext} from 'react'

export default function Notes() {
    const context = useContext(noteContext)
  const {state} = context;

  return (
    <div>
        {
        state.map((note) => {
          // return <div key={note.id}>{note.title}</div>
          return note.title;
          })
      }
      
    </div>
  )
}
